package com.adventofcode.dec2018.day5

import org.junit.jupiter.api.Assertions.assertEquals
import org.junit.jupiter.api.Test

class PolymerReactorTest {

    val input = "dabAcCaCBAcCcaDA"

    val actualInput = ""

    @Test
    fun `should compute reaction`() {
        val reactor = PolymerReactor()
        assertEquals("dabCBAcaDA", reactor.processReactions(input))
    }

    @Test
    fun `should compute actual reaction`() {
        val reactor = PolymerReactor()
        assertEquals(11194, reactor.processReactions(actualInput).length)
    }

    @Test
    fun `should optimize polymer`() {
        val reactor = PolymerReactor()
        assertEquals(4, reactor.optimizePolymer(input))
    }

    @Test
    fun `should optimize actual polymer`() {
        val reactor = PolymerReactor()
        assertEquals(4178, reactor.optimizePolymer(actualInput))
    }
}